  useEffect(() => {
    console.log('inUSEEFFECT', currentPage);
  }, [currentPage]);

  return (
    <>
      <Container
        sx={{
          display: 'flex',
          flexDirection: 'column',
          alignItems: 'center',
          width: '100%',
          height: '100%',
          padding: '0',
          margin: '0',
        }}
      >
        <Controller />
      </Container>
      {currentPage === 'signUp' ? null :
      <Paper
        sx={{ position: 'fixed', bottom: 10, left: 0, right: 0 }}
        elevation={3}
      >
        <BottomNavigation
          showLabels
          value={value}
          onChange={(event, newValue) => {
            setValue(newValue);
          }}
        >
          <BottomNavigationAction
            label='Health'
            onClick={() => {
              setCurrentPage('health');
            }}
            icon={<MonitorHeartIcon />}
          />
          <BottomNavigationAction
            label='Home'
            onClick={() => {
              setCurrentPage('home');
              console.log(currentPage);
            }}
            icon={<HomeIcon />}
          />
          <BottomNavigationAction
            label='Chat'
            onClick={() => {
              setCurrentPage('chat');
            }}
            icon={<ForumIcon />}
          />
          <BottomNavigationAction
            label='maps'
            onClick={() => {
              setCurrentPage('maps');
            }}
            icon={<LocationOnIcon />}
          />
        </BottomNavigation>
      </Paper>
}
    </>
  );
